import NavBar from './components/NavBar';
import Home from './components/Home';
import PlayStoreStats from './components/PlayStoreStats'
import Monetize from './components/Monetize.js'
import Footer from './components/Footer.js'
import TradingTopics from './components/TradingTopics';
import PastEvents from './components/PastEvents';
import ReferAFriend from './components/ReferAFriend';
import RewardsAndTutorial from './components/RewardsAndTutorial';
import Slider from 'react-animated-slider';
import 'react-animated-slider/build/horizontal.css';

function App() {
  const slides = [
    { title: 'First item', description: 'Lorem ipsum'},
    { title: 'Second item', description: 'Lorem ipsum'}
  ];
  return (
    <div className="App container-fluid">
      <div id='top-panel' className='app'>
      <NavBar/> 
        <Home/>
      </div>
      {/* <PlayStoreStats/>
      <Monetize/>
      <TradingTopics/>
      <RewardsAndTutorial/>
      <PastEvents/>
